import React, {useState} from 'react';

function TodoRender(props) {
    const editing = false;
    const edit_Index = 0;
    const edit_text = "No te salio wacho";
    while (editing === false){
        const lista= props.lista
        var deletefunction = props.deletefunction
        var editfunction = props.editfunction
        const push_render = lista.map((action, index) =>  <li key={index}>{action}<button onClick= {editing = true , edit_Index = index, edit_text= action}> Edit  </button> <button onClick={()=> deletefunction(lista, index)}> Delete  </button></li>);
        
        return (
            <ul>{push_render}</ul>
        ); 
    }
    
    return (
        <ul> <li> {edit_Index}</li> <li> {edit_text}</li></ul>
    );
   
    
}
export default TodoRender;
